    template <>
    int NativesCollection<EXTRAS>::GetIndex(const char* name)
    {
        if (strcmp(name, "CommonStrings") == 0)
            return 0;
        if (strcmp(name, "ByteLengthQueuingStrategy") == 0)
            return 1;
        if (strcmp(name, "CountQueuingStrategy") == 0)
            return 2;
        if (strcmp(name, "ReadableStream") == 0)
            return 3;
        if (strcmp(name, "WritableStream") == 0)
            return 4;

//         if (strcmp(name, "test-extra") == 0)
//             return 0;
        return -1;
    }

    template <>
    Vector<const char> NativesCollection<EXTRAS>::GetScriptSource(int index)
    {
        if (index == 0)
            return Vector<const char>(kCommonStringsData, sizeof(kCommonStringsData));
        if (index == 1)
            return Vector<const char>(kByteLengthQueuingStrategy, sizeof(kByteLengthQueuingStrategy));
        if (index == 2)
            return Vector<const char>(kCountQueuingStrategy, sizeof(kCountQueuingStrategy));
        if (index == 3)
            return Vector<const char>(kReadableStream, sizeof(kReadableStream));
        if (index == 4)
            return Vector<const char>(kWritableStream, sizeof(kWritableStream));
        
//         if (index == 0)
//             return Vector<const char>(sources + 0, 2133);
        return Vector<const char>("", 0);
    }

    template <>
    Vector<const char> NativesCollection<EXTRAS>::GetScriptName(int index)
    {
        if (index == 0)
            return Vector<const char>("native CommonStrings.js", 23);
        if (index == 1)
            return Vector<const char>("native ByteLengthQueuingStrategy.js", 35);
        if (index == 2)
            return Vector<const char>("native CountQueuingStrategy.js", 30);
        if (index == 3)
            return Vector<const char>("native ReadableStream.js", 24);
        if (index == 4)
            return Vector<const char>("native WritableStream.js", 24);

//         if (index == 0)
//             return Vector<const char>("native test-extra.js", 20);
        return Vector<const char>("", 0);
    }

    template <>
    Vector<const char> NativesCollection<EXTRAS>::GetScriptsSource()
    {
        return Vector<const char>(sources, 2133);
    }
